import 'bootstrap/dist/css/bootstrap.min.css';
import './Inicio.css'
import logo from '../../assets/images/logo-principal.png';

const Inicio = () => {
    return (
        <div className="m-4">
            <div className="border d-flex align-items-center justify-content-between">
  {/* Imagen del logo alineada a la izquierda */}
  <img src={logo} alt="Logo" className="img-fluid logo" />

  {/* Elementos flexibles alineados a la derecha */}
  <div className="d-flex">
    <div className="p-2">Flex item 1</div>
    <div className="p-2">Flex item 2</div>
  </div>
</div>

        </div>
    );
};

export default Inicio;
